('2288','18','7841','Villa Particia',Null,'Moderne Villa in ruhiger Wohnlage in Costa de la Calma','32354','Costa de la Calma liegt in der Gemeinde Calvia im Südwesten Mallorcas und zählt zu den beliebtesten Wohnlagen in dieser Region. Diese Villa wurde 2010 im modernen Baustil erstellt und bietet ca 230m² Wohnfläche. Diese verteilen sich auf 2 Wohnebenen. Über den Eingang in der oberen Etage ( EG Strassenlevel) betritt man ein helles Wohn-Esszimmer mit moderne offener Küche der sich ein Wirtschaftsraum anschließt. Hier befinden sich noch ein Gäste WC und das Hauptschlafzimmer mit Bad en suite sowie eine Terrasse mit Blick auf den Pool. \r\nIm Untergeschoss (Gartenlevel) hat einen 40m² großen Multi Raum, 1 Gästeschlafzimmer mit Bad en suite, ein Büroraum, Hauswirtschaftsraum und ein Badezimmer. \r\nEingebettet im angelegten Garten (Kunstrasen)  liegt ein 15mx3,5m großer Pool.\r\nZur Ausstattung der Villa gehören eine Klimaanlage (kalt) eine elektrische Fußbodenheizung, Doppelglas Panoramafenster und Laminat Böden. Die moderne und sehr gepflegte Villa bietet noch 1 Abstellraum, 1 offenen- und 2 überdachte Autostellplätze. \r\n','32355','1650000','106','2014-11-20 13:59:15','106','2014-11-20 14:00:04',Null,'2310','85','1088',1,'1','0',Null,Null,Null,'32356',Null,'0','0','0',Null,'2015-04-15 16:33:43',1,'0',Null,Null,Null,Null,'5',1,1,1,'1','1','1',1,1,Null,'32357',Null,'32358',Null,'32359',Null,'32360','666 908 833  patriciamaurabujosa@hotmail.com','32361','0',0,'4');
